<!DOCTYPE html>
<html>
<head>
	<title></title>
	<link href='https://fonts.googleapis.com/css?family=Roboto:400,700,500' rel='stylesheet' type='text/css'>
	<style type="text/css" media="screen">

		* {
			box-sizing: border-box;
			margin: 0;
			padding: 0;
		}

		html, body {
			height: 100%;
			padding-top: 5px;
		}

		body {
			margin: 0;
			padding: 0;
			min-height: 100%;
			font-family: 'Roboto', sans-serif;
		}

		.bg-blue {
			background: linear-gradient(-45deg, #62a5d3, #93cde6);
			background-size: cover;
			background-repeat: no-repeat;
		}

        .mainContainer {
            text-align: center;
            display: table-cell;
            vertical-align: middle;
            height: 100%;
            width: 100%;
            position: fixed;
            margin: 0;
            left: 0;
            top: 0;
        }

		.container {
			width: 30%;
			margin: 0 auto;
			padding-top: 50px;
		}

		.card {
			box-shadow: 0 27px 55px 0 rgba(0, 0, 0, 0.3), 0 17px 17px 0 rgba(0, 0, 0, 0.15);
			border-radius: 2px;
			background-color: #fafafa;
		}

		.img-responsive {
			display: block;
			max-width: 70%;
			height: auto;
		}

		.img-logo {
			padding: 40px 20px;
		}

		.img-center {
			margin: 0 auto;
		}

		.brand {
			text-align: center;
			color: #fff;
			font-size: 70px;
			text-shadow: 1px 0px rgba(0, 0, 0, 0.23);
			margin-top:-60px;
			padding-bottom: 20px;
		}

		.card-text {
			padding: 36px;
			line-height: 1.6;
			font-size: 16px;
		}

		.card-actions {
			border-top: 1px solid #e0e0e0;
			padding: 18px 36px;
		}

		.card-actions a {
			text-decoration: none;
			text-transform: uppercase;
			color: rgba(0, 174, 239, 1);
			padding: 6px 12px;
			transition: all 0.15s ease-in-out;
		}

		.card-actions a:hover {
			background-color: #eee;
			transition: all 0.15s ease-in-out;
		}

		.card-actions a:active {
			background-color: #ddd;
			transition: all 0.15s ease-in-out;
		}

	</style>
</head>
<body class="bg-blue">

    <div class="mainContainer bg-blue">
    	<div class="container">
            <img
                src="data:image/png;base64,"
                class="img-responsive img-center img-logo"
            >
			<p class="brand">MaceVC</p>
    		<div class="card">
    			<p class="card-text">
    				Whoops! Looks like something went wrong. <br>
    				Try going back.
    			</p>
    			<div class="card-actions">
    				<a href="/">Go back</a>
    			</div>
    		</div>

    	</div>
    </div>

</body>
</html>
